import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <FirstComponent />
      </div>
    );
  }
}
class FirstComponent extends Component {
  render() {
    return <div className="firstComponent">Class Component</div>;
  }
}
export default App;
